import axios from 'axios';
import {GET_USERS} from '../actionTypes/actionTypes';

const fetchUsers = () => {
  return dispatch => {
    axios.get('http://vidyaback.appelloproject.xyz/api/users/')
    .then(response => {
      console.log(response,'response')
    })
  }
}

export default fetchUsers
